import "./App.css";
import Courses from "./components/Page/Courses/indexCourses";
import Teachers from "./components/Page/Teachers/indexTeacher";
import Students from "./components/Page/Students/indexStudent";
import Navbar from "./components/Page/Teachers/Navbar";

function App() {
  return (
    <div>
      <div>
        <Switch>
          <Route exact path="/indexCourses">
            <Movies movies={filterFilms('movie')} />
          </Route>
          <Route exact path="/series">
            <Series series={filterFilms('tvSeries')} />
          </Route>
          <Route exact path="/documentaries">
            <Documentaries documentaries={filterFilms('documentary')} />
          </Route>
          <Route exact path="/watchlist">
            <WatchList />
          </Route>
          <Route path="*">
            <h1>404 not found</h1>
          </Route>
        </Switch>
      </div>

      <Navbar />
      <Teachers />
      <Courses />
      <Students />
    </div>
  );
}

export default App;
